  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import '../../styles/scss/theme.scss';
import t from '../../i18n';
import { PropsTable, Playground } from 'docz';
import { Label } from '../src/index';

export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}>
<MDXTag name="h1" components={components} props={{"id":"entry-label"}}><MDXTag name="strong" components={components} parentName="h1">{`Entry Label`}</MDXTag></MDXTag>

<PropsTable of={Label} />
<MDXTag name="h2" components={components} props={{"id":"label"}}>{`Label`}</MDXTag>
<MDXTag name="h3" components={components} props={{"id":"exemplos"}}>{`Exemplos`}</MDXTag>
<Playground __codesandbox={`undefined`} __position={1} __code={`<Label>{t(\'common.label\')}</Label>
<Label htmlFor="rotulo">{t(\'common.label\')} </Label>`} __scope={{props: this ? this.props : props,t,Label}}>
    <Label>{t('common.label')}</Label>
<Label htmlFor='rotulo'>{t('common.label')} </Label>
</Playground>
           </MDXTag>
  }
}
